import React, { useState } from 'react';
import { authService, companyService } from '../services/api';

const TestPage = () => {
  const [testResult, setTestResult] = useState('');
  const [loading, setLoading] = useState(false);

  const testConnection = async () => {
    setLoading(true);
    setTestResult('جاري اختبار الاتصال...');
    
    try {
      // اختبار الاتصال بالباك إند
      const response = await fetch('https://aithor2-production.up.railway.app/api/company/check');
      
      if (response.ok) {
        setTestResult('✅ الاتصال بالباك إند يعمل بشكل صحيح!\n\nالآن يمكنك:\n1. إنشاء حساب جديد من صفحة /register\n2. تسجيل الدخول من صفحة /login\n3. استخدام جميع المميزات');
      } else {
        const error = await response.text();
        setTestResult(`⚠️ الباك إند يعمل لكن هناك خطأ: ${error}`);
      }
    } catch (error) {
      setTestResult(`❌ خطأ في الاتصال: ${error.message}\n\nتأكد من:\n1. أن الباك إند يعمل على Railway\n2. أن الرابط صحيح\n3. أن الإنترنت يعمل`);
    } finally {
      setLoading(false);
    }
  };

  const testAuth = async () => {
    setLoading(true);
    setTestResult('جاري اختبار المصادقة...');
    
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        setTestResult('❌ لا يوجد توكن في التخزين المحلي\nيرجى تسجيل الدخول أولاً');
        setLoading(false);
        return;
      }

      const response = await authService.verifyToken();
      if (response.valid) {
        setTestResult(`✅ التوكن صالح!\n\nالمستخدم: ${response.user.name}\nالبريد: ${response.user.email}`);
      } else {
        setTestResult('❌ التوكن غير صالح\nيرجى تسجيل الدخول مرة أخرى');
      }
    } catch (error) {
      setTestResult(`❌ خطأ في التحقق من التوكن: ${error.message}`);
    } finally {
      setLoading(false);
    }
  };

  const testCompanyAPI = async () => {
    setLoading(true);
    setTestResult('جاري اختبار API الشركة...');
    
    try {
      const response = await companyService.getCompany();
      setTestResult(`✅ تم جلب بيانات الشركة بنجاح!\n\nاسم الشركة: ${response.name || 'غير محدد'}\nالقطاع: ${response.industry || 'غير محدد'}`);
    } catch (error) {
      if (error.response?.status === 404) {
        setTestResult('⚠️ لم يتم العثور على شركة\nيرجى إكمال إعداد الشركة من لوحة التحكم');
      } else {
        setTestResult(`❌ خطأ في جلب بيانات الشركة: ${error.message}`);
      }
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ 
      minHeight: '100vh', 
      display: 'flex', 
      alignItems: 'center', 
      justifyContent: 'center',
      padding: '20px',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)'
    }}>
      <div className="card" style={{ width: '100%', maxWidth: '600px' }}>
        <div className="text-center mb-20">
          <h1 style={{ 
            fontSize: '2rem', 
            fontWeight: '700', 
            color: '#667eea',
            marginBottom: '10px'
          }}>
            اختبار الاتصال والخدمات
          </h1>
          <p style={{ color: '#6c757d' }}>
            اختبار الاتصال بين الفرونت إند والباك إند
          </p>
        </div>

        <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '10px', marginBottom: '20px' }}>
          <button
            onClick={testConnection}
            className="btn btn-primary"
            disabled={loading}
          >
            اختبار الاتصال
          </button>
          <button
            onClick={testAuth}
            className="btn btn-secondary"
            disabled={loading}
          >
            اختبار المصادقة
          </button>
        </div>

        <div style={{ marginBottom: '20px' }}>
          <button
            onClick={testCompanyAPI}
            className="btn btn-secondary"
            style={{ width: '100%' }}
            disabled={loading}
          >
            اختبار API الشركة
          </button>
        </div>

        {testResult && (
          <div style={{
            padding: '15px',
            borderRadius: '8px',
            background: testResult.includes('✅') ? '#d4edda' : 
                       testResult.includes('⚠️') ? '#fff3cd' : '#f8d7da',
            border: testResult.includes('✅') ? '1px solid #c3e6cb' : 
                   testResult.includes('⚠️') ? '1px solid #ffeaa7' : '1px solid #f5c6cb',
            color: testResult.includes('✅') ? '#155724' : 
                   testResult.includes('⚠️') ? '#856404' : '#721c24',
            whiteSpace: 'pre-line'
          }}>
            {testResult}
          </div>
        )}

        <div style={{ marginTop: '20px', fontSize: '0.9rem', color: '#6c757d' }}>
          <p><strong>رابط الباك إند:</strong> https://aithor2-production.up.railway.app/api</p>
          <p><strong>رابط الفرونت إند:</strong> http://localhost:3000</p>
          <p><strong>الحالة:</strong> {loading ? 'جاري الاختبار...' : 'جاهز للاختبار'}</p>
        </div>
      </div>
    </div>
  );
};

export default TestPage;
